import React from 'react';
import ContactUsComp from '../components/about-us/AboutUs';
import Layout from '../components/common/Layout';

const ContactUs = () => (
  <>
    <Layout>
      <ContactUsComp />
    </Layout>
  </>
);

export default ContactUs;
